    public static char[][] StringToArray(String _mapString) {
            String[] lines = _mapString.split("\\r?\\n");
            char[][] _mapArray = new char[lines.length][lines[0].length()];
            int row = 0;
            for (String line : lines) {
                    int col = 0;
                    for (char chr : line.toCharArray()) {
                            _mapArray[row][col] = chr;
                            col++;
                    }
                    row++;
            }

            return _mapArray;
    }

    public static int[] FindStart(char[][] map) {
        int[] startPos = new int[2];
        for (int i = 0; i < map.length; i++) {
            for (int j = 0; j < map[0].length; j++) {
                if (map[i][j] == '1') {
                    startPos[0] = i;
                    startPos[1] = j;
                }
            }
        }
        return startPos;

    }

